import './ExpenseItem.css';

function ExpenseItem () {
  return (
    <div className="expense-item">
      <div className="expense-item__description">Feb 13 2023</div>
      <div>
        <h2>Car Expense </h2>
        <div className="">2000 Rs</div>{' '}
      </div>
    </div>
  )
}
export default ExpenseItem
